svg.size(3.25, 1)
  .padding(0.05)
  .strokeWidth(0.005);

const bottomLayer = svg.g();
const layer = svg.g();
const topLayer = svg.g();
const facesLayer = svg.g()
  .translate(1.25, 0.5);

const colors = {
  true: "#e53",
  false: "white",
  0: "white",
  1: "#e53",
  2: "#fb4",
};

const draw_matrix = (matrix) => {
  const group = svg.g();
  const num_faces = matrix.length;
  const rect_w = 1 / num_faces;
  group.rect(1, 1).stroke("black").fill("white");
  Array.from(Array(num_faces))
    .map((_, i) => Array.from(Array(num_faces))
      .map((_, j) => group
        .rect(i/num_faces, j/num_faces, rect_w, rect_w)
        .stroke("none")
        .fill(colors[matrix[i][j]])));
  return group;
};

const update = (cp, matrix, facePolys, point) => {
  bottomLayer.removeChildren();
  topLayer.removeChildren();
  const near = cp.nearest(point);
  if (near.face === undefined) { return; }
  // console.log("face", near.face, "edge", near.edge);
  // highlight faces on cp
  matrix[near.face]
    .map((value, i) => value === undefined
      ? undefined
      : { value, i })
    .filter(a => a !== undefined)
    .map(el => bottomLayer
      .polygon(cp.faces_vertices[el.i]
        .map(v => cp.vertices_coords[v]))
      .fill(colors[el.value]));
  bottomLayer
    .polygon(cp.faces_vertices[near.face]
      .map(v => cp.vertices_coords[v]))
    .fill("#38c");

  // draw layers
  facePolys.forEach(face => face
    .fill("#e53")
    .opacity(0.0));
  facePolys
    .filter((_, i) => matrix[near.face][i])
    .forEach(face => face.opacity(0.15));
  // the blue face
  facePolys[near.face].remove();
  facePolys[near.face]
    .opacity(1)
    .fill("#38c")
    .appendTo(facesLayer);

  // grid indicator
  const num_faces = cp.faces_vertices.length;
  const w = 1 / num_faces;
  topLayer.rect(-w / 2, near.face / num_faces - (w / 2), 1 + w, w * 2)
    .translate(2.25, 0)
    .fill("none")
    .stroke("black")
    .strokeWidth(w);
};

const load = (FOLD) => {
  layer.removeChildren();
  facesLayer.removeChildren();

  const eps = 1e-6;
  const cp = ear.origami(FOLD).populate();
  const folded = cp.flatFolded(0);
  let layers_up = [];
  let layers_flipped = [];
  
  // all solutions, or,
  const conditions = ear.layer.all_layer_conditions(folded, eps);
  // one solution only.
  // const conditions = [ear.layer.one_layer_conditions(folded, eps)];
  console.log(conditions.length, "solutions", conditions);

  if (conditions.length) {
    const layers_face = ear.layer.topological_order(conditions[0]);
    layers_up = ear.graph.invert_map(layers_face);
    layers_flipped = ear.graph.invert_map(layers_face.slice().reverse());
    console.log("layers_face", layers_face);
  }

  // make some matrices for vizualization only
  const overlap_matrix = ear.graph.make_faces_faces_overlap(folded, eps);
  const conditions_matrix = Array
    .from(Array(folded.faces_vertices.length))
    .map(() => Array(folded.faces_vertices.length).fill(0));
  overlap_matrix
    .forEach((row, r) => row
      .forEach((b, c) => conditions_matrix[r][c] = (b ? 1 : 0)));
  if (conditions.certain) {
    Object.keys(conditions.certain)
      .filter(key => conditions.certain[key] !== 0)
      .forEach(key => {
        const pair = key.split(" ");
        conditions_matrix[pair[0]][pair[1]] = 2;
        conditions_matrix[pair[1]][pair[0]] = 2;
      });
  }

  // draw things
  folded.faces_layer = layers_up;
  layer.origami(folded).translate(1.25, -0.25);
  folded.faces_layer = layers_flipped;
  layer.origami(folded).translate(2.25, -0.25);

  const foldedFaces = folded.faces_vertices
    .map(vertices => vertices
      .map(v => folded.vertices_coords[v]));
  const facePolys = foldedFaces
    .map(face => ear.svg.polygon(face)
      .fill("#e53")
      .appendTo(facesLayer));
  layer.origami(cp, {
    faces: { fill: "none" },
    boundaries: { fill: "none" },
    edges: {
      mountain: { stroke: "#e53" },
      valley: { stroke: "#38c" },
    }
  });

  cp.edges_vertices
    .map(edge => edge.map(v => cp.vertices_coords[v]))
    .map(verts => ear.math.midpoint2(...verts))
    .forEach((center, i) => layer
      .text(`${i}`, ...center)
      .fontSize(0.04)
      .fontFamily("sans-serif")
      .fill("#000"));
  ear.graph.make_faces_center(cp)
    .forEach((center, i) => layer
      .text(`${i}`, ...center)
      .fontSize(0.06)
      .fontFamily("sans-serif")
      .fill("#5b3"));

  // draw_matrix(overlap_matrix)
  //   .translate(2.25, 0)
  //   .appendTo(layer);

  // draw_matrix(conditions_matrix)
  //   .translate(2.25, 0)
  //   .appendTo(layer);

  svg.onMove = (e) => update(cp, conditions_matrix, facePolys, e);
  // update(cp, overlap_matrix, facePolys, [0.3, 0.69]);
};

